import React from 'react';
import { useState } from 'react';

const Start_New_Topic = () => {
    const [title, setTile] = useState('')
    const [text, setText] = useState('')

    return (
        <div>
            <input type="text" placeholder="Započni novu temu" title="Molim vas, proverite prvo u listi sa leve strane da li tema koju pokrećete već postoji" required 
            onInput={e => {setTile(e.target.value)}}/>
            <input type="text" placeholder="Ostavite prvu poruku na vašoj novoj temi" required onInput={e => {setText(e.target.value)}}/>
            <input type="submit" value="Započni novu temu"/>
        </div>
    )
}

export default Start_New_Topic;
